(async function () {
    console.log("RuneAgent initialized (local)");

    // Get directory path from this script's location
    const basePath = "client/";

    // Load modules from the same directory
    const loadScript = src => new Promise((resolve, reject) => {
        const script = document.createElement('script');
        script.src = basePath + src;
        script.onload = resolve;
        script.onerror = reject;
        document.head.appendChild(script);
    });

    const modules = [
        'core/globals.js',
        'core/streams.js',
        'core/packet.js',
        'core/hooks.js',
        'core/mob.js',
        'core/player.js',
        'handlers/mob-info.js',
        'handlers/filters.js',
        'handlers/drunken-dwarf.js',
        'handlers/zone.js',
        'ui/util.js',
        'ui/log.js',
        'ui/ui-panels.js',
        'ui/bot-panel.js',
        'util/file.js',
        'util/event-capture.js'
    ];

    for (let mod of modules) await loadScript(`./${mod}`);

    if (typeof initializeRuneAgent === "function") {
        initializeRuneAgent();
    }
})();



